## Daily File Instructions

1. After creating your feature branch (with the name `feature-XXX`), ensure you follow the steps below to configure the repository for your feature branch.

1.1 - Slack Notifications

Change slack-channel for notifications.

- .cicd/build/Jenkinsfile: To send build messages to fivebelow-dev-cicd channel.

```
            slackSend(

                 channel: "#${CUSTOMER_NAME}-dev-cicd",

                 color: COLOR_MAP[currentBuild.currentResult],

                 message: message
             )
         }
     }
}
}
```

- .cicd/airflow/Jenkinsfile: To send build messages to fivebelow-dev-cicd channel.

```
STORE_CODE

                 slackSend(

                     channel: "#${CUSTOMER_NAME}-dev-cicd",

                     color: COLOR_MAP[currentBuild.currentResult],

                     message: message
                 )
             }
         }
```
